create database if not exists panaderia;

use panaderia;

create table if not exists usuarios(cod_usuario varchar(50) primary key not null
                                   ,nombres text not null ,passw text not null
                                   ,active int not null);
create table if not exists producto(cod_producto int auto_increment primary key ,nombre text not null
                     ,foto longtext,descripcion text not null ,precio double not null,active int not null );
create table if not exists inventario(cod_inventario int auto_increment primary key
                                     ,fk_cod_producto int not null,fk_cod_proveedor varchar(50) not null
                                     ,cantidad int not null
                                     ,precio_tot double not null,fecha_compra datetime not null
                                     ,fecha_registro datetime not null );
create table if not exists proveedores(cod_proveedor varchar(50) primary key ,nombre varchar(200)
                                      ,telefono varchar(50),direcc text,
                                      email varchar(50),encargado text,activo int);
create table if not exists detalle_venta(id_detalle_venta int auto_increment primary key
                                        ,fk_id_factura int not null
                                        ,id_producto int,cantidad int not null
                                        ,precio double not null );
create table if not exists factura(id_factura int auto_increment primary key,fk_cod_usuario varchar(50)
                                  ,dni_cliente varchar(50) not null ,nombres text not null
                                  ,precio_tot double not null
                                  ,fecha_venta datetime not null );

ALTER TABLE factura
ADD FOREIGN KEY (fk_cod_usuario) REFERENCES usuarios(cod_usuario);

ALTER TABLE detalle_venta
ADD FOREIGN KEY (fk_id_factura) REFERENCES factura(id_factura);

ALTER TABLE detalle_venta
ADD FOREIGN KEY (id_producto) REFERENCES producto(cod_producto);

alter table proveedores auto_increment = 900;
alter table producto auto_increment = 100;
alter table factura auto_increment = 200;
alter table detalle_venta auto_increment = 500;













